function dropdown2(props) {
  const position = {
    container: "relative",
    itemWrapper: "absolute right-full w-max",
    item: "py-2 px-4",
  };
  const design = {
    itemWrapper: "bg-white",
    headingWrapper: "list-none [&::-webkit-details-marker]:hidden",
    item: "cursor-pointer rounded-lg hover:bg-gray-50",
  };
  return (
    <details className={position.container}>
      <summary clasName={design.headingWrapper}>
        <p>{props.heading}</p>
      </summary>
      <div className={`${position.itemWrapper} ${design.itemWrapper}`}>
        {props.text.map((item, index) => (
          <p className={`${position.item} ${design.item}`} key={index}>
            {item}
          </p>
        ))}
      </div>
    </details>
  );
}

export default dropdown2;
